import React from "react";
import first from './images/tall-building.jpg';
import second  from './images/waterfall.jpg';
import third from './images/underground-aquarium.jpg'
export default function Footer() {
    return (
        <footer className="footer">
            <div>
            <img src={first} className='footer-img' alt="footer"/>
            <p>A fascinating builing</p>
            </div>
            <img src={second} className='footer-img' alt="footer"/>
            <img src={third} className='footer-img' alt="footer"/>
        </footer>
    );
}
